in_source: |-
  .data:
      str STRING Hello,
      buf BUFFER 64

  .code:
      JMP start

  print:
      DUP
      LOAD
      JZ after_print
      OUTPUT
      INC
      JMP print

  after_print:
      RET

  start:
      PUSH buf

  read:
      DUP
      INPUT
      JZ after_read
      POP
      INC
      JMP read

  after_read:
      DROP ; 0
      DROP ; dupped buf
      DROP ; buf
      PUSH str
      CALL print
      DROP ; 0
      DROP ; str
      PUSH buf
      CALL print
      DROP ; 0
      DROP ; str
      HLT
